Install Terraform Initialise cloud provider Run "terraform init" Set-up a security group Make sure that you set up the file Try whether or not it works with "terraform plan" . Here we would expect something to add but not necessarily something to change or to destroy. Don't display your credentials openly, you would probably want to use something like Ansible vault or similar to store your credentials, do not store in plain text Once we have finished setting up our resources, we want to destroy them "terraform destroy" tf is the file extension that Terraform uses Note that you can find all available information on a data source. Common question: What is the difference between Ansible and Terraform They are both used for provisioning the infrastructure However, Terraform also has the power to provision the infrastructure Ansible is better for configuring the infrastructure and deploying the application Both could be used in combination I am doing this example on my local kind cluster â€” have a look at one of the previous videos to see how to set-up kind We are using a mixture of the following tutorials https://registry.terraform.io/providers/hashicorp/kubernetes/latest/docs/guides/getting-started https://learn.hashicorp.com/tutorials/terraform/kubernetes-provider?in=terraform/use-case Create your cluster e.g. with kind kind-config.yaml kind: Cluster
apiVersion: kind.x-k8s.io/v1alpha4
nodes:
- role: control-plane extraPortMappings: - containerPort: 30201 hostPort: 30201 listenAddress: "0.0.0.0" Then run kind create cluster --name terraform-learn --config kind-config.yaml For our terraform.tfvar file, we need the following information [host](https://learn.hashicorp.com/tutorials/terraform/kubernetes-provider?in=terraform/use-case#host) corresponds with clusters.cluster.server. [client_certificate](https://learn.hashicorp.com/tutorials/terraform/kubernetes-provider?in=terraform/use-case#client_certificate) corresponds with users.user.client-certificate. [client_key](https://learn.hashicorp.com/tutorials/terraform/kubernetes-provider?in=terraform/use-case#client_key) corresponds with users.user.client-key. [cluster_ca_certificate](https://learn.hashicorp.com/tutorials/terraform/kubernetes-provider?in=terraform/use-case#cluster_ca_certificate) corresponds with clusters.cluster.certificate-authority-data. To get those, run: "kubectl config view --minify --flatten --context=kind-terraform-learn" # terraform.tfvars host = "https://127.0.0.1:32768"
client_certificate = "LS0tLS1CRUdJTiB..."
client_key = "LS0tLS1CRUdJTiB..."
cluster_ca_certificate = "LS0tLS1CRUdJTiB..." This is our terraform .tf file terraform { required_providers { kubernetes = { source = "hashicorp/kubernetes" } }
} variable "host" { type = string
} variable "client_certificate" { type = string
} variable "client_key" { type = string
} variable "cluster_ca_certificate" { type = string
} provider "kubernetes" { host = var.host client_certificate = base64decode(var.client_certificate) client_key = base64decode(var.client_key) cluster_ca_certificate = base64decode(var.cluster_ca_certificate)
} resource "kubernetes_namespace" "test" { metadata { name = "nginx" }
}
resource "kubernetes_deployment" "test" { metadata { name = "nginx" namespace = kubernetes_namespace.test.metadata.0.name } spec { replicas = 2 selector { match_labels = { app = "MyTestApp" } } template { metadata { labels = { app = "MyTestApp" } } spec { container { image = "nginx" name = "nginx-container" port { container_port = 80 } } } } }
}
resource "kubernetes_service" "test" { metadata { name = "nginx" namespace = kubernetes_namespace.test.metadata.0.name } spec { selector = { app = kubernetes_deployment.test.spec.0.template.0.metadata.0.labels.app } type = "NodePort" port { node_port = 30201 port = 80 target_port = 80 } }
} Now we can run terraform init terraform plan terraform apply Make sure that all your resources are within the right path and it should work.

